import React from "react";

export default function Header() {
  return (
    <div style={headerStyle}>
      <h1>TODO LIST</h1>
    </div>
  );
}
const headerStyle = {
  backgroundColor: "#555",
  color: "#fff",
  textAlign: "center"
};
